import style from "./aside.module.scss";

const Aside = ({
  marca,
  filtrarVeiculos,
  veiculoFiltrado,
}) => {
  return (
    <div className={style.container}>
      <label>
      <Form>
          <Form.Check
            type="switch"
            id="custom-switch"
            key={marca + index}
            veiculosFiltrados={veiculosFiltrados}
            setVeiculoFiltrado={setVeiculosFiltrados}
            marca={marca}
            filtrarVeiculos={filtrarVeiculos}
            automoveis={automoveis}
          />
        </Form>
        {marca}
      </label>
    </div>
  );
};
export default Aside;
